import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import HomeContent from '../src/components/Home.js'
import ContactContent from '../src/components/Contact'
import NewsContent from './components/News';


function App() {
  return (
    <div className="App">
<>
<Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/news">News</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/news">
            <News />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
</>
    </div>
  );
}


function Home() {
  return <HomeContent/>;
}

function News() {
  return <NewsContent/>;
}

function Contact() {
  return <ContactContent/>;
}


export default App;
